<div id="toggleText" style="display: none;">
	<div class="blue_box">
		<p>Wir verarbeiten Rind- und Schweinefleisch aus artgerechter NEULAND-Haltung und Fisch aus nachhaltiger Fischerei und Bio-Aquakultur. Nach regionaler Verfügbarkeit setzen wir Obst und Gemüse aus ökologischer Landwirtschaft ein. Das Studentenwerk Oldenburg ist zertifiziert nach der EG-Öko Verordnung, kontrolliert von der Gesellschaft für Ressourcenschutz (GfRS, DE-039-Öko).</p>
		<p>Wir verwenden nur in Ausnahmefällen Lebensmittel mit kennzeichnungspflichtigen Zusatzstoffen.</p>
	</div>
	<p>Speisen und Getränke kennzeichnen wir entsprechend der lebensmittelrechtlichen Anforderungen. Die zugelassenen, kennzeichnungspflichtigen Zusatzstoffe sind auf unseren Mensaplänen in Form von Kennziffern wie folgt kenntlich gemacht:</p>
	<table border="0" class="nopadding smallfont" style="width: 100%;">
		<tbody>
			<tr>
				<td>
					<p>1. mit Farbstoff</p>
					<p>2. mit Konservierungsstoffen</p>
					<p>3. mit Antioxidationsmittel</p>
					<p>4. mit Geschmacksverstärker</p>
					<p>5. geschwefelt</p>
					<p>6. geschwärzt</p>
					<p>7. gewachst</p>
					<p>8. mit Süßungsmittel</p>
					<p>9. enthält Phenylalaninquelle</p>
					<p>10. mit Phosphat</p>
					<p>11. koffeinhaltig</p>
					<p>12. kakaohaltige Fettglasur</p>
					<p>A: mit Alkohol</p>
				</td>
				<td>
					<p>Ei Eier</p>
					<p>En Erdnuss</p>
					<p>Fi Fisch</p>
